import { createStore } from "vuex";

export default createStore({
  state: {
    user: null,
    token: null,
  },
  getters: {},
  mutations: {
    setSession(state, user, token) {
      state.user = user;
      state.token = token;
    },
  },
  actions: {},
  modules: {},
});
